import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  const user = {
    name: 'Aiymkoz',
    secondName: 'Bigaliyeva',
  }
  return (
    <div>
      <div>Hello world!</div>
      <div>
        This is Ms. {user.name + ' ' + user.secondName}
      </div>
    </div>
  );
}

export default App;
